  `OPD_NEW_PAT` char(1) NOT NULL DEFAULT 'N',
  `OPD_DATE_VIS` date NOT NULL,
  `OPD_PROG_YEAR` int(11) NOT NULL,
  `OPD_SEX` char(1) NOT NULL,
